import React, {Component} from "react"
import TeamMember from "./TeamMember";

class Team extends Component{
    constructor(){
        super()
        this.state = {
             memberInfo: [
                {id:5, img: '/images/dev2.jpg',     name: 'Taaif Ayaad',    position: 'Web Engineer',   phone: '0582926733',    email: 'taaif@gmail.com',   website: 'taaifayaad.com' },
                {id:3, img: '/images/dev1.png',    name: 'Ahamed Khalid',  position: 'Web Engineer',   phone: '0582926733',    email: 'ahmad@gmail.com',   website: 'ahmadkhalid.com'},
                {id:6, img: '/images/des1.png',    name: 'Farah Saad',     position: 'Designer',       phone: '0582926733',    email: 'farah@gmail.com',   website: 'farahsaad.com'},
                {id:1, img: '/images/des2.jpg',    name: 'Talal Ayed',     position: 'Designer',       phone: '0582926733',    email: 'talal@gmail.com',                            },
                {id:4, img: '/images/prog1.jpg',   name: 'Abdulmajeed Ahmad', position: 'Programmer',  phone: '0582926733',    email: 'abdulmajeed@gmail.com',                        },
                {id:2, img: '/images/prog2.jpg',   name: 'Sara Saad',      position: 'Programmer',     phone: '0582926733',    email: 'sara@gmail.com',                                },
            ]
        }
    }
mapping(x){
    const members = x.map(member => <TeamMember
        key={member.id}
        img={member.img}
        name={member.name}
        position={member.position}
        phone={member.phone}
        email={member.email}
        website={member.website}
    />);
    return members
}

    render(){

        return(
            <div className="row">
                {this.mapping(this.state.memberInfo)}   
            </div>
        );
    }
}

export default Team ;
